import React from 'react';
import Home from './Home';
import { Routes, Route } from "react-router-dom";
const App = () => {
  return (
    <Routes>
      <Route exact path="/" element={<IndexPage />} />

      <Route exact path="/services" element={
        <ServicesLayout>
          <ServiseCards />
        </ServicesLayout>} />

      <Route exact path="/services/api/create" element={
        <ServicesLayout>
          <Create />
        </ServicesLayout>} />

      <Route exact path="/services/api/pants" element={
        <PantsProduct />}
      />
      <Route exact path="/services/api/pillow" element={
        <PillowService />}
      />
      <Route exact path="/services/api/tajrbit" element={
        <TajrbitService />}
      />

      <Route exact path="/services/conform" element={
        <InfoDetails />}
      />

    </Routes>
  );
}

export default App;
